column8:
メーカー希望小売価格はメーカータグに基づいて掲載しています<br><br>

大人気！口金シリーズのボストンバッグです。開口部のファスナーを開けると、がばっ！と開く人気の口金入りボストンバッグ。軽やかな生地のポリエステルキャンバスを使用しており、軽量なのにA4サイズ収納可能で大容量！<br>
<br>
持ち手は肩掛け出来る長さなので、ざくざく荷物を入れてもしっかり持てます。通勤通学・トラベルにも最適。<br>
<br>
素材：ポリエステル<br>
重さ：約400g<br>
開口部メイン：ファスナー<br>
<br>
サイズ：36cm×26cm×22cm <br>
<br>
※サイズ目安：A4サイズ収納可能<br>
持ち手長さ：54cm<br>
<br>
【外側ポケット】<br>
ファスナーポケット×1<br>
【内側ポケット】<br>
オープンポケット×2<br>
<br>
性別：ユニセックス<br>
<br>
※生地や個体差でサイズと重さが若干異なる場合ございます。<br>
<br>
※色目に関してはご覧頂いているディスプレイやスマートフォンの画面により、画像と実物の差がある場合がございますが予めご了承ください。<br><style type="text/css">
